import React from 'react';

const MealTable = ({ meals, onSwapMeal }) => {
  const handleSwapClick = (day, mealType) => {
    onSwapMeal(day, mealType);
  };

  return (
    <table>
      <thead>
        <tr>
          <th>Day</th>
          <th>Meal Type</th>
          <th>Ingredients</th>
          <th>Instructions</th>
          <th>Nutrition</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {meals.map((meal, index) => (
          <tr key={index}>
            <td>{meal.day}</td>
            <td>{meal.mealType}</td>
            <td>{meal.ingredients}</td>
            <td>{meal.instructions}</td>
            <td>{meal.nutrition}</td>
            <td>
              <button onClick={() => handleSwapClick(meal.day, meal.mealType)}>Swap</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default MealTable;
